import React from 'react'

export default function Headline(props) {
  return(
    <div className="newsHeadline">
      <div className="headline">
        <div className="nameSubreddit">{props.title}</div>
        <div className="headlineSubreddit">{props.subreddit}</div>
      </div>
      <div className="newsThumbnail">{props.thumbnail}</div>
    </div>
  )
}
